import React from 'react'
import './ChartsPage.css'
function ChartsPage() {
    const objects =[
        {name:'asd',data:[14,15,13,52,34,22]},

];



    return (
        <div className="ChartsPage">
            {objects.map((object)=>(
                    <BarChart data={object.data}
                    name={object.name}/>
                    ))}  
        </div>
    )
}

export default ChartsPage
